class Solution {
    private val mod = 1000000007

    fun count(num1: String, num2: String, minSum: Int, maxSum: Int): Int {
        fun dfs(idx: Int, tight: Int, sum: Int, dp: Array<Array<IntArray>>, digits: List<Int>): Int {
            if (idx == -1) return if (sum in minSum..maxSum) 1 else 0
            if (sum > maxSum) return 0
            if (tight != -1 && dp[idx][tight][sum] != -1) return dp[idx][tight][sum]

            val up = if (tight == 1) digits[idx] else 9
            var ans = 0
            for (d in 0..up) {
                ans = (ans + dfs(idx - 1, if (tight == 1 && d == up) 1 else 0, sum + d, dp, digits)) % mod
            }
            if (tight != -1) dp[idx][tight][sum] = ans
            return ans
        }

        fun solve(num: String): Int {
            val digits = num.map { it - '0' }.reversed()
            val n = digits.size
            val dp = Array(n) { Array(2) { IntArray(maxSum + 1) { -1 } } }
            return dfs(n - 1, 1, 0, dp, digits)
        }

        val num1Int = num1.toBigInteger() - BigInteger.ONE
        val ans1 = solve(num1Int.toString())
        val ans2 = solve(num2)
        val ans = (ans2 - ans1 + mod) % mod
        return ans.toInt()
    }
}
